INSERT INTO `umiejetnosci` (`UmiejetnoscID`, `Opis`) VALUES
(1, 'sprawdzenie stanu technicznego podstawowych elementów pojazdu odpowiedzialnych bezpośrednio za bezpieczeństwo jazdy'),
(2, 'przygotowanie do jazdy: właściwe ustawienie fotela, lusterek, zagłówków i zapięcie pasów bezpieczeństwa, upewnienie się, czy drzwi pojazdu są zamknięte, włączenie świateł odpowiednich do jazdy w ruchu drogowym'),
(3, 'płynne ruszenie'),
(4, 'ruszanie z miejsca do przodu na wzniesieniu'),
(5, 'płynna jazda pasem ruchu do przodu i tyłu'),
(6, 'nienajeżdżanie kołem na linie wyznaczające zewnętrzne krawędzie stanowisk'),
(7, 'nienajeżdżanie na pachołki lub tyczki oraz niepotrącanie ich'),
(8, 'zatrzymanie pojazdu przed końcem i początkiem pasa ruchu'),
(9, 'właściwe sygnalizowanie zamiaru zmiany kierunku jazdy'),
(10, 'parkowanie skośne'),
(11, 'parkowanie prostopadłe przodem'),
(12, 'parkowanie prostopadłe tyłem'),
(13, 'parkowanie równoległe'),
(14, 'zawracanie');
